import React, {Component} from "react";
import "./product.css"
import ProductItem from "./product-item/product-item";
import {Pagination} from "@mui/lab";


export default class Product extends Component {
    state = {
        show1: false,
        show2: false,
        show3: false,
        filterMenu: true,
        filterType: "",
        page: 1
    };

    filterProduct = (product, filterType) => {
        return product.filter( (item) => item.type == filterType);
    };

    filterMenu = () => {
        this.setState(({filterMenu}) => {
            return {
                filterMenu: !filterMenu,
            }
        });
    };


    filterButtons1 = [
        {type: 'windows-1', label: 'Пластиковые в квартиру и дома', pictures:"data:image/png;base64,"},
        {type: 'windows-2', label: 'Алюминиевые остекления', pictures: "data:image/png;base64,"},
        {type: 'windows-3', label: 'Индивидуальны решения', pictures: "data:image/png;base64,"},
    ]
    filterButtons2 = [
        {type: 'input-doors-1', label: 'Входная группа квартиры, офисы', pictures: "data:image/png;base64,"},
        {type: 'input-doors-2', label: 'Термоударные', pictures: "data:image/png;base64,"},
        {type: 'input-doors-3', label: 'Противопожарные и технические.', pictures: "data:image/png;base64,"},
    ]
    filterButtons3 = [
        {type: 'interior-doors-1', label: 'Царговые', pictures: "data:image/png;base64,"},
        {type: 'interior-doors-2', label: 'Шпонированые', pictures: "data:image/png;base64,"},
        {type: 'interior-doors-3', label: 'Массив', pictures: "data:image/png;base64,"},
    ]
    onFilterChange = (filterType) => {
        this.setState({filterType})
    }
    render() {
        const handleChange = (event, value) => {
            this.setState({
                page: value,
            })
        };
        const {products} = this.props;

var productsSlice = products.slice( (this.state.page-1)*30, 30*this.state.page)

        var filterProducts;
        if (this.state.filterType) {
            filterProducts =  this.filterProduct(productsSlice, this.state.filterType)
        }
        else {
            filterProducts = productsSlice
        }
        const element2 = filterProducts.map((item) => {
            return (
                <ProductItem {...item}/>
            )
        })
        const filterButtons1 = this.filterButtons1.map(({type, label, pictures}) => {
            return (
                <a onClick={() => this.onFilterChange(type)} type="button" className="filter-blocks">
                <div key={type}>Окна<br/></div>
                    <img className="filter-images" src={pictures}/>{label}
        </a>
            )
        });
        const filterButtons2 = this.filterButtons2.map(({type, label, pictures}) => {
            return (
                <a onClick={() => this.onFilterChange(type)} type="button" className="filter-blocks">
                <div  key={type}>Двери входные<br/></div>
                    <img className="filter-images" src={pictures}/>{label}
        </a>
            )
        });
        const filterButtons3 = this.filterButtons3.map(({type, label, pictures}) => {
            return (
                <a type="button" onClick={() => this.onFilterChange(type)} className="filter-blocks">
                <div key={type}>Двери межкомнатные<br/></div>
                    <img className="filter-images" src={pictures}/>{label}
                    </a>
            )
        });

        return (
            <div className="product">
                <div className="box-3">
                    <div onClick={this.filterMenu} className="btn">
                        <span className="filter">Фильтры</span>
                    </div>
                </div>
                <div className="filter-main-block">
                    <a type="button" onClick={() => this.onFilterChange()} className="filter-blocks">
                        <div className="filter-block-all">Все</div></a>
                    {filterButtons1}
                    {filterButtons2}
                    {filterButtons3}
                </div>


                <div className="product-items">
                    {element2}
                </div>
                <div className="pagination-block">
                    <Pagination
                        className="pagination-noBootstrap"
                        count={Math.ceil(products.length/30)}
                        color="primary"
                        onChange={handleChange}/>
            </div>
            </div>
        )
    }
}
